import React from 'react';
import { FiPower } from 'react-icons/fi';
import { Container, Header, HeaderContent, Profile } from './styles';

import logoImg from '../../assets/logo.svg';
import { useAuth } from '../../hooks/auth';

const Dashboard: React.FC = () => {
  const { signOut } = useAuth();

  return (
    <Container>
      <Header>
        <HeaderContent>
          <img src={logoImg} alt="GoBarber" />

          <Profile>
            <img
              src="https://scontent.fssz4-1.fna.fbcdn.net/v/t1.0-9/81372042_2623632174372422_3540091806924406784_n.jpg?_nc_cat=106&_nc_sid=09cbfe&_nc_ohc=e3-aphbJrooAX91zjyD&_nc_ht=scontent.fssz4-1.fna&oh=06ced6b167633ea085650ac7a757b845&oe=5F296F90"
              alt="Gustavo Serao"
            />

            <div>
              <span> Bem Vindo,</span>
              <strong> Gustavo Ser√£o</strong>
            </div>
          </Profile>

          <button type="button" onClick={signOut}>
            <FiPower />
          </button>
        </HeaderContent>
      </Header>
    </Container>
  );
};

export default Dashboard;
